import React from "react";
import { useAuth0 } from '@auth0/auth0-react'

const inicio = () => {
    return (
        <nav class="navbar">
        <ul>
            <li><a href="#">Inicio</a></li>
            <li><a href="#">Quienes Somos</a></li>
            <li><a href="#">Productos</a></li>
            <li><a href="#">Contacto</a></li>
        </ul>
        </nav>
    )
}
export default inicio
